/**
 * @param {string} s
 * @return {number}
 */
// https://leetcode.com/problems/longest-substring-without-repeating-characters/
// 29.22%
var lengthOfLongestSubstring = function (s) {
  // 存到以某个位置字符开始的最大长度
  let lenList = []

  // 最大长度
  let longestLen = 0
  let i = 0
  while (i < s.length) {
    // 当前元素开始的长度肯定为 1
    lenList.push(1)

    if (longestLen < 1) {
      longestLen = 1
    }

    // 遍历list，更新最大值
    let j = i - 1

    while (j >= 0) {
      // [j+1,i] 的子串
      const substr = s.substr(j + 1, i - j)

      // 是否包含
      if (!substr.includes(s[j])) {
        lenList[j] = lenList[j + 1] + 1

        // 记录最大值
        if (longestLen < lenList[j]) {
          longestLen = lenList[j]
        }
      } else {
        break
      }

      j -= 1
    }

    i += 1
  }

  return longestLen
};

